import { Link, Route, Routes } from "react-router-dom";
import AddUserForm from "./components/adduser";

const App = () => {
  return (
    <>
      <Link to="/AddUserForm">AddUserForm</Link>
      <Routes>
        <Route
          path="/frontend/src/components/adduser"
          element={<AddUserForm />}
        ></Route>
      </Routes>
    </>
  );
};

export default App;
